import React from "react";
import HomeLayouts from "../Layouts/HomeLayouts";

const index = () => (
  <React.Fragment>
    <HomeLayouts>
      <section className="inner-banner inner-banner__two">
        <div className="container flex-row d-flex justify-content-between align-items-center">
          <h2 className="inner-banner__title">Contact</h2>
          {/* /.inner-banner__title */}
          <ul className="thm-breadcrumb">
            <li className="thm-breadcrumb__item">
              <a href="index.html" className="thm-breadcrumb__link">
                Home
              </a>
            </li>
            {/* /.thm-breadcrumb__item */}
            <li className="thm-breadcrumb__item current">
              <a href="#" className="thm-breadcrumb__link">
                Contact
              </a>
            </li>
            {/* /.thm-breadcrumb__item */}
          </ul>
          {/* /.thm-breadcrumb */}
        </div>
        {/* /.container */}
      </section>
      {/* /.inner-banner */}
      <section className="contact-info-one">
        <div className="container">
          <div className="row">
            <div className="col-lg-4">
              <div className="contact-info-one__single">
                <h3 className="contact-info-one__title">Address</h3>
                {/* /.contact-info-one__title */}
                <p className="contact-info-one__text">
                  Suite 266 Street, Washington DC <br /> United States
                </p>
                {/* /.contact-info-one__text */}
              </div>
              {/* /.contact-info-one__single */}
            </div>
            {/* /.col-lg-4 */}
            <div className="col-lg-4">
              <div className="contact-info-one__single">
                <h3 className="contact-info-one__title">Phone</h3>
                {/* /.contact-info-one__title */}
                <p className="contact-info-one__text">
                  Local: 000 8888 9999 <br /> Mobile: 999 666 444
                </p>
                {/* /.contact-info-one__text */}
              </div>
              {/* /.contact-info-one__single */}
            </div>
            {/* /.col-lg-4 */}
            <div className="col-lg-4">
              <div className="contact-info-one__single">
                <h3 className="contact-info-one__title">Email</h3>
                {/* /.contact-info-one__title */}
                <p className="contact-info-one__text">
                  needhelp@inston.com <br /> inquiry@inston.com
                </p>
                {/* /.contact-info-one__text */}
              </div>
              {/* /.contact-info-one__single */}
            </div>
            {/* /.col-lg-4 */}
          </div>
          {/* /.row */}
        </div>
        {/* /.container */}
      </section>
      {/* /.contact-info-one */}
    </HomeLayouts>
  </React.Fragment>
);

export default index;
